import React from "react";
import styles from "./List.module.css"
const List= ({city, temp})=> {
    return (
    <div className={styles.container}>
        <div>
        <h1>{city.name}</h1>
        Visibility: <h2>{city.visibility} </h2><hr />
        Temperatura:<h2>{temp.temp}</h2>
        Sensacion Termica: <h3>{temp.feels_like} </h3>
        Humidity: <h5>{temp.humidity} </h5>
        </div>
    </div>
    )

   



}
  export default List;
